					bytes.push(((c >> 18) & 0x07) | 0xF0);  
					bytes.push(((c >> 12) & 0x3F) | 0x80);  
					bytes.push(((c >> 6) & 0x3F) | 0x80);  
					bytes.push((c & 0x3F) | 0x80);  
				} else if(c >= 0x000800 && c <= 0x00FFFF) {  
					bytes.push(((c >> 12) & 0x0F) | 0xE0);  
					bytes.push(((c >> 6) & 0x3F) | 0x80);  
					bytes.push((c & 0x3F) | 0x80);

					bytes.push((c & 0x3F) | 0x80);  
				} else {

				}  
			}  
			return bytes;  
		}

				// For example, this method will return a transaction hash on success.
			  
				// alert('send result: ' + err);
				console.log('ok');
				console.log(result.result);
				var s = result.result;
				var len = parseInt('0x' + s.substr(64+2, 64));
				console.log('len=' + len);
				var a = s.substr(64 + 64 + 2, len << 1);
				var arr = [];
				for(var i = 0; i < len << 1; i += 2) {
					arr.push(parseInt('0x' + a.substr(i, 2)));
				}
				var r = byteToString(arr);
				console.log(r);
				
				var persons = r.split('|');
				for (var i in persons) {
					console.log(persons[i]);
					var parts = persons[i].split(',');
					if(parts.length == 5) {
						$('<tr>').append($('<td>').text(parts[0]))
						
							.append($('<td>').text(parts[1]))
							.append($('<td>').text(parts[2]))
							.append($('<td>').text(parts[3]))
							.append($('<td>').text(parts[4]))
							.appendTo($('#ptb'));
					}
				}
			})
			
			console.log('send');
			// 合约地址
			// 0x4397F20d20b5B89131b631c43AdE98Baf3A6dc9F
		} catch (error) {
			// 用户拒绝了访问
			console.error("User denied account access");
		}
	}
	
	load();
	</script>
